取得したい型名のメソッドで型を変換します。
object str = "1";
int ret = str.Int(); //1 as int

Sets the value to a property of an object by its path from the root.
The object can be a complex object and the property can be multi level deep nested property or it can be a property directly under the root. ObjectWriter will find the property using the property path parameter and update its value. Property path is the appended names of the properties visited from root to the end node property which we want to set, delimited by the delimiter string parameter.
Usage:
For setting up the properties directly under the object root: Ie. LineItem class has an int property called ItemId LineItem lineItem = new LineItem();
ObjectWriter.Set(lineItem, "ItemId", 13, delimiter: null);
For setting up nested property multiple levels below the object root: Ie. Invite class has a property called State, which has a property called Recipient, which has a property called Id. Here is how you can set the Id property (to string value of “outlook”) at the bottom of the object tree in a single line. Invite invite = new Invite(); ObjectWriter.Set(invite, "State_Recipient_Id", "outlook", delimiter: "_"); This will set invite.State.Recipient.Id to “outlook” You also do not need to worry about instantiating the properties State or Recipient, ObjectWriter.Set method will instantiate those if they are null along the way.
